md"""
#### Beispiel
Fakultät Rechnuner
"""

# ╔═╡ ad7da12b-03a0-4d4f-8faf-fa37703e63ad
function fakultaet(n)
	if isinteger(n) && n >= 0    # Check ob n eine Zahl und nicht Negativ!
		a = 1
		if n==0                  # Check ob n ist gerade 0 und gib 1 zurück
			return 1
		else
			for k in 1:n         # Fakultät von 1 bis n berechnen
			a = a * k
			end
			return a
		end
	else
		return nothing
	end
	
end

