md"""
### c. Plots mit mehreren y-Achsen
"""

# ╔═╡ 5ccc98f4-0bf5-43a4-838b-31b11601a843
begin
time = collect(0:5:60)
breathing_rate = 12 .+ 8 .* rand(length(time))
SpO2 = 90 .+ 10 .* rand(length(time))

p = plot() # Anlegen eines leeren Plots
p_twin = twinx(p) # Anlegen eines zweiten Plots, der dieselbe x-Achse hat, aber eine y-Achse auf der rechten Seite.
plot!(p, time, breathing_rate, # Wenn als erstes Argument in der plot-Funktion ein Plot-Objekt übergeben wird, werden die Daten in diesen Plot hinzugefügt
	label = "Atemrate",
	yaxis = "1 / min",
	legend = :topleft)
plot!(p_twin, time, SpO2,
	label = "Sauerstoffsättigung",
	color = :red,
	xaxis = "Time / min",
	yaxis = "SpO2 / %",
	title = "My fancy twinx Plot",
	legend = :topright)
end

