# ╔═╡ ab49fbe4-c7f2-465e-b43c-19ba093b88f1
datensatz = CSV.read("ECGData.csv", DataFrame)

# ╔═╡ 9efbb6c6-7a0c-4626-95ec-8bc5b44edbc9
md"""
### b. Daten extrahieren
Man muss sich den Datensatz als eine Tabelle vorstellen!
"""

# ╔═╡ 767bf81c-8cf8-4e3e-9a69-aea361d5858e
datensatz.Daten 

