datensatz[10,:Daten]

# ╔═╡ aaf16b68-4abd-456f-b5e1-950381b0b6ae
md"""
##### Zeitstempel in DateTime Objekt umwandlen
"""

# ╔═╡ 225245c0-38c8-4f9d-b7c6-36d23e539bee
test_time_stamp = 20221028123255

# ╔═╡ 54e34642-f67b-4aa6-a378-d18b9cdb3db6
test_time_stamp_DT = DateTime(string(test_time_stamp), dateformat"yyyymmddHHMMSS")

# ╔═╡ ca548de8-449d-4de3-aded-daf0a8c732f0
md"""
###### DateTime Opertationen:
"""

# ╔═╡ eec13e91-25e8-421c-a2ae-96a510395c2e
day(test_time_stamp_DT)

# ╔═╡ 3e8eb653-64e1-47fc-8107-58434bd1e58b
month(test_time_stamp_DT)

# ╔═╡ fa60d6b3-a117-437b-8d9f-896ad68be0ea
year(test_time_stamp_DT)

# ╔═╡ 1729652e-6b52-49b4-957b-2de3201257a1
test_time_stamp_DT + Minute(10)

# ╔═╡ eda08107-b671-4653-9147-6bc19eeaea16
datensatz.Zeitstempel = DateTime.(string.(datensatz.Zeitstempel),"yyyymmddHHMMSS")

# ╔═╡ dafd8e29-f942-45c9-b38a-33207b7da08a
md"""
#### Beispiel:
Datensatz der Ableitung 4 von Patient Nummer 13 plotten.

Wir müssen zuerst die Daten von CSV format in einen Vektor umwandeln, dafür brauchen wir eine Funktion
"""

# ╔═╡ 7e98ec89-5d43-4dec-81ac-214a3fe1389d
function parse_formatted_string(input)
	elements = split(input, ";")
	return parse.(Int64, elements)
end

# ╔═╡ 3f2ff579-637a-4f56-9f07-4b9e447e259b
# Daten umwandlen 
datensatz.Daten = parse_formatted_string.(datensatz.Daten)

# ╔═╡ 15ea59f5-d0b9-4457-bcab-90b2242305fc
# Daten der Ableitung 4 von Patient Nr 13 extrahieren
daten_13_4 = datensatz[datensatz.Ableitung .== 4 .&& datensatz.Patientennummer .== 13, :Daten][1]

# ╔═╡ 5ea88345-88e8-4359-8ea0-969f4678591c
md"""
$(info(md"Mit **findall(datensatz.Ableitung .== 7)** können Sie alle Zeilen-Indizes aus dem Datensatz finden, die mit Ableitung 7 entstanden sind. Alternativ kann der korrekte Zeilen-Index natürlich auch in den Daten abgelesen werden."))
"""

# ╔═╡ 141f43b6-27d5-4c4a-a7a2-4d73640eeaeb
plot(daten_13_4, label="Patient 13, Ableitung 4", xlabel="Zeit", ylabel="Amplitude", legend_position=:bottom)

